import React from 'react'
import {data} from './data'
import adri from '../../public/images/'


const Projects = () => {

    return (
        <section id='projects'>
            <div className="container">
                <h2>Projects</h2>
                <img src="../../public/images/adriana.jpg" alt="" />
                {data.map((item) => {
                    const {id, image, title} = item;
                    return <div key={id}>
                        <img src={image} alt='' />
                        <h1>{title}</h1>
                    </div>
                })} 
            </div>
        </section>
    )
}

export default Projects
